import "./App.css";
import React from "react";
import Navbar from "./components/Navbar/Navbar";
import { BrowserRouter as Router, Swith, Route } from "react-router-dom";

function App() {
	return (
		<Router>
			<Navbar></Navbar>
			<Swith>
				<Route></Route>
			</Swith>
		</Router>
	);
}

export default App;
